function exampleData() {
    this.data = { nodes: [], links: [] };
    var nodes = ['A', 'B', 'C', 'E', 'F', 'G', 'H', 'I', 'J', 'K', 'L', 'M', 'N'];

    for (var i = 0; i < 15; i++) {
        var rnd1 = Math.floor(Math.random() * nodes.length);
        var rnd2 = Math.floor(Math.random() * (nodes.length - 1));
        if (rnd2 >= rnd1)
            rnd2++;
        this.data.links.push({ source: rnd1, target: rnd2, weight: 1 });
    }
    this.data.nodes = nodes.collect(function(node) {
        return { name: node };
    });
}

